import React from "react";
import "./contactform.css";
const ContactForm=()=>{
    return(

        <form className="form">
     <h1>Contact form</h1>
     <label>Name</label>
     <input placeholder="Gmail"/>
     <label>gmail</label>
     <input placeholder="name"/>
     <label>Message</label>
     <textarea placeholder="message"></textarea>
     <button type="submit">Submit</button>
        </form>
    );
}
export default ContactForm;
